import { Button } from "@material-ui/core";
import React from "react";
import { auth } from "./firebase.js";

function SignOut() {
  return (
    <div>
      <Button onClick={() => auth.SignOut()}>Log Out</Button>
    </div>
  );
}

export default SignOut;
